import React, { useState, useEffect, useRef } from 'react';

import './App.css';
import backgroundImage from './img/bg.png';
import Header from './components/header';
import Navbar from './components/nav';
import About from './components/about';

function App() {

  return (
    <div className="scrollbar bg-pink-200 h-screen w-screen px-60 py-4 overflow-hidden">

      <div className='w-full bg-gray-50 rounded-t-lg text-center py-1'>
        <p className='font-semibold text-xs'>BRING YOUR VISIONS TO LIFE</p>
      </div>

      <div className='scrollbar bg-purple-50 h-full overflow-y-scroll rounded-b-lg text-dark font-mono drop-shadow-md border'>
        <Header />

        <Navbar />

        <div className=''>
          <section id='0' className='bg-blue-200'>
            <About />
          </section>

          <section id='1' className='bg-blue-300 h-full'>
            works
          </section>

          <section id='2' className='bg-blue-400 h-f'>
            background
          </section>

          <section id='3' className='bg-blue-500 h-screen'>
            education
          </section>

          <section id='4' className='bg-blue-600 h-screen'>
            contact
          </section>

        </div>
      </div>
    </div>
  );
}

export default App;
